        "message": "The only way to do great work is to love what you do.",
        "author": "Steve Jobs"
    },
    {
        "message": "Success is not the key to happiness. Happiness is the key to success.",
        "author": "Albert Schweitzer"
    },
    {
        "message": "Believe you can and you're halfway there.",
        "author": "Theodore Roosevelt"
    },
    {
        "message": "In the end, it's not the years in your life that count. It's the life in your years.",
        "author": "Abraham Lincoln"
    },
    {
        "message": "Don't watch the clock; do what it does. Keep going.",
        "author": "Sam Levenson"
    },
    {
        "message": "The best way to predict the future is to create it.",
        "author": "Peter Drucker"
    },
    {
        "message": "It always seems impossible until it's done.",
        "author": "Nelson Mandela"
    },
    {
        "message": "Success is walking from failure to failure with no loss of enthusiasm.",
        "author": "Winston Churchill"
    },
    {
        "message": "Life is 10% what happens to us and 90% how we react to it.",
        "author": "Charles R. Swindoll"
    },
    {
        "message": "The only limit to our realization of tomorrow will be our doubts of today.",
        "author": "Franklin D. Roosevelt"
    },
    {
        "message": "Don't be pushed around by the fears in your mind. Be led by the dreams in your heart.",
        "author": "Roy T. Bennett"
    },
    {
        "message": "The road to success and the road to failure are almost exactly the same.",
        "author": "Colin R. Davis"
    },
    {
        "message": "Do not dwell in the past, do not dream of the future, concentrate the mind on the present moment.",
        "author": "Buddha"
    },
    {
        "message": "The best preparation for tomorrow is doing your best today.",
        "author": "H. Jackson Brown Jr."
    },
    {
        "message": "I can't change the direction of the wind, but I can adjust my sails to always reach my destination.",
        "author": "Jimmy Dean"
    },
    {
        "message": "Your work is going to fill a large part of your life, and the only way to be truly satisfied is to do what you believe is great work. And the only way to do great work is to love what you do.",
        "author": "Steve Jobs"
    },
    {
        "message": "Keep your face always toward the sunshine - and shadows will fall behind you.",
        "author": "Walt Whitman"
    },
    {
        "message": "What lies behind us and what lies before us are tiny matters compared to what lies within us.",
        "author": "Ralph Waldo Emerson"
    },
    {
        "message": "Happiness is not something ready made. It comes from your own actions.",
        "author": "Dalai Lama"
    },
    {
        "message": "You must do the things you think you cannot do.",
        "author": "Eleanor Roosevelt"
    },
    {
        "message": "Strive not to be a success, but rather to be of value.",
        "author": "Albert Einstein"
    },
    {
        "message": "Don't be afraid to give up the good to go for the great.",
        "author": "John D. Rockefeller"
    },
    {
        "message": "It's not whether you get knocked down, it's whether you get up.",
        "author": "Vince Lombardi"
    },
    {
        "message": "The future belongs to those who believe in the beauty of their dreams.",
        "author": "Eleanor Roosevelt"
    },
    {
        "message": "Believe in yourself and all that you are. Know that there is something inside you that is greater than any obstacle.",
        "author": "Christian D. Larson"
    },
    {
        "message": "Life is what happens when you're busy making other plans.",
        "author": "John Lennon"
    },
    {
        "message": "Dream big and dare to fail.",
        "author": "Norman Vaughan"
    },
    {
        "message": "Whatever you are, be a good one.",
        "author": "Abraham Lincoln"
    },
    {
        "message": "In the middle of every difficulty lies opportunity.",
        "author": "Albert Einstein"
    },
    {
        "message": "Keep your eyes on the stars, and your feet on the ground.",
        "author": "Theodore Roosevelt"
    },
    {
        "message": "The only way to achieve the impossible is to believe it is possible.",
        "author": "Charles Kingsleigh"
    },
    {
        "message": "Don't be pushed by your problems; be led by your dreams.",
        "author": "Ralph Waldo Emerson"
    },
    {
        "message": "Either you run the day, or the day runs you.",
        "author": "Jim Rohn"
    },
    {
        "message": "The only person you are destined to become is the person you decide to be.",
        "author": "Ralph Waldo Emerson"
    },
    {
        "message": "It does not matter how slowly you go as long as you do not stop.",
        "author": "Confucius"
    },
    {
        "message": "Success is not the key to happiness. Happiness is the key to success. If you love what you are doing, you will be successful.",
        "author": "Albert Schweitzer"
    },
    {
        "message": "What you get by achieving your goals is not as important as what you become by achieving your goals.",
        "author": "Zig Ziglar"
    },
    {
        "message": "Success is not how high you have climbed, but how you make a positive difference to the world.",
        "author": "Roy T. Bennett"
    },
    {
        "message": "Challenges are what make life interesting. Overcoming them is what makes life meaningful.",
        "author": "Joshua J. Marine"
    },
    {
        "message": "The greatest glory in living lies not in never falling, but in rising every time we fall.",
        "author": "Nelson Mandela"
    },
    {
        "message": "Strive not to be a success, but rather to be of value.",
        "author": "Albert Einstein"
    },
    {
        "message": "The greatest discovery of all time is that a person can change his future by merely changing his attitude.",
        "author": "Oprah Winfrey"
    },
    {
        "message": "Every great dream begins with a dreamer. Always remember, you have within you the strength, the patience, and the passion to reach for the stars to change the world.",
        "author": "Harriet Tubman"
    },
    {
        "message": "It is our choices, that show what we truly are, far more than our abilities.",
        "author": "J.K. Rowling"
    },
    {
        "message": "Success is not the absence of failure; it's the persistence through failure.",
        "author": "Aisha Tyler"
    },
    {
        "message": "The biggest risk is not taking any risk. In a world that is changing quickly, the only strategy that is guaranteed to fail is not taking risks.",
        "author": "Mark Zuckerberg"
    },
    {
        "message": "The only thing that stands between you and your dream is the will to try and the belief that it is actually possible.",
        "author": "Joel Brown"
    },
    {
        "message": "Life is what we make it, always has been, always will be.",
        "author": "Grandma Moses"
    },
    {
        "message": "You are never too old to set another goal, or to dream a new dream.",
        "author": "C.S. Lewis"
    },
